import React from 'react';
import logo from '../../Images/Logo.sv';
import styles from './logo.module.css';

function Logo() {
   return (
      <div className={styles.logo}>
         <img
            src={logo}
            alt='logo'
            className={styles['logo-img']}
         ></img>
         <p><strong>Books</strong>React</p>
      </div>
   );
}

export default Logo;
